import React, { useState } from 'react';
import { Img, Link, Logo, MobileNavbarContainer, MobileNavbarHeader, StyledAppBar, StyledButton, StyledIconButton, StyledNavLinks, StyledNavMobile, StyledToolbar } from './styles';
import { TiThMenu } from 'react-icons/ti';
import logo from '../../assets/logo.svg';
import { Button } from '@material-ui/core';
import './mobileNavbarStyles.css';

const Navbar = () => {
  const [open, setOpen] = useState(false);

  const handleMenuOpen = () => {
    setOpen(true);
  };

  const handleMenuClose = () => {
    setOpen(false);
  };

  return (
    <div>
      <StyledAppBar position="static">
        <StyledToolbar>
          <Logo>
            <Img src={logo} />
            Leiturama
          </Logo>
          <StyledIconButton edge="start" color="inherit" aria-label="menu" onClick={handleMenuOpen}>
            <TiThMenu />
          </StyledIconButton>
          <StyledNavLinks>
            <Link>Planos</Link>
            <Link>Benefícios</Link>
            <Link>Como Funciona</Link>
          </StyledNavLinks>
          <StyledButton variant="outlined">Assinar</StyledButton>
        </StyledToolbar>
      </StyledAppBar>

      {open && <MobileNavbar onClose={handleMenuClose} />}
    </div>
  );
};

const MobileNavbar = ({ onClose }) => {
  return (
    <MobileNavbarContainer>
      <MobileNavbarHeader>
        <h2>Menu</h2>
        <Button onClick={onClose} color="primary">
          X
        </Button>
      </MobileNavbarHeader>
      <StyledNavMobile>
        <Link>Planos</Link>
        <Link>Benefícios</Link>
        <Link>Como Funciona</Link>
      </StyledNavMobile>
    </MobileNavbarContainer>
  );
};

export default Navbar;
